  "6qQ9ELKz49K2PHHiReeB61": "<span>Gebruik vertrouwde netwerken:</span> open uw Web3 wallet alleen op beveiligde netwerken. Openbare Wi-Fi-netwerken zijn onbeveiligd, waardoor uw digitale activa aan risico's worden blootgesteld.",
