  "91ff22cfdfae4000a6d9": "PCI DSS (Payment Card Industry Data Security Standard) is de wereldwijde standaard voor gegevensbeveiliging in de betaalkaartenbranche. PCI DSS is ontwikkeld door grote kredietkaartorganisaties zoals Visa, MasterCard en American Express en heeft ten doel de gegevens van kaarthouders te beschermen en kredietkaartfraude, hacking en beveiligingsproblemen te voorkomen.\n\nPCI DSS bestaat uit 12 kernvereisten voor beveiliging die netwerkbeveiliging, gegevensbescherming, kwetsbaarheidsbeheer, toegangscontrole, netwerkbewaking en een beleid voor informatiebeveiliging omvatten. Alle winkeliers en dienstverleners die kredietkaartgegevens verwerken, opslaan of verzenden moeten aan deze normen voldoen.\n\n{brandName} is PCI-gecertificeerd, wat aantoont dat de maatregelen voor gegevensbeveiliging aan internationaal erkende normen voldoen. Deze certificering verzekert de effectieve bescherming van de kredietkaartgegevens en andere gevoelige gegevens van klanten tegen inbreuken en fraude.",
  "91xXw22xZhCYxYVeDdhx4i": "Maximum aantal geüploade bestanden: {num}.",
  "92eq8vZsMSwqhGko8WYXAy": "Storten",
  "93515e63f9a64000a1f4": "DNS-beveiliging",
  "93KEpBLkX7fLmtuwVAmBrC": "Het doelbereik verlaat",
  "93RVzcYHsLpzdLqoXhjq1b": "<span>Beperkte ondersteuning en kwetsbaarheid voor fouten:</span> Web3 wallets hebben meestal geen toegewijde klantenondersteuning en zijn gevoelig voor gebruikersfouten, zoals wanneer geld naar het verkeerde adres wordt verzonden. Ze hebben ook vaak geen diensten voor de directe conversie van fiat naar crypto.",
  "93a9284459b84000a20f": "Max. APR: {apr}",
  "93bamwKq383WFycaKTMQEd": "Accounts kunnen nadat ze zijn verwijderd niet worden samengevoegd. Neem contact met de <a href='{a}' target='_blank' rel='noopener noreferrer'>klantendienst</a> op als u accounts wilt samenvoegen",
  "94HZ4AG61AYiY8N7PidjXH": "Wanneer u crypto verhandelt door anderen te kopiëren, moet u zich nog steeds bewust zijn van systematische risico's die op de hele markt van invloed zijn, zoals wijzigingen in de regelgeving of grote wereldwijde gebeurtenissen. Deze factoren kunnen invloed op elke cryptovaluta hebben, inclusief die in uw portefeuille. Door de strategieën van anderen te spiegelen, bent u niet alleen aan de risico's van hun besluitvorming blootgesteld, maar ook aan deze bredere marktdynamiek. Zo kan een plotselinge verschuiving in de regelgeving of een ernstig probleem met een grote cryptobeurs een grote invloed op de marktomstandigheden hebben, met gevolgen voor uw beleggingen. Het is dus belangrijk dat u uw portefeuille en handelsstrategieën diversifieert om risico's te spreiden.",
  "969274b779d14000ab7b": "Back-ups en herstel van gegevens",
  "96ae3df671f24000ab05": "{brandName} gebruikt zorgvuldig geselecteerde, sterke versleutelingsalgoritmen om ervoor te zorgen dat alle communicatie tegen onbevoegd onderscheppen of manipulatie door derden wordt beschermd. Dit omvat sleuteluitwisselingsalgoritmen die voorwaartse geheimhouding ondersteunen zoals ECDHE (Elliptic Curve Diffie-Hellman Ephemeral), en symmetrische versleutelingsalgoritmen zoals AES (Advanced Encryption Standard) en ChaCha20. Deze algoritmen worden wereldwijd om hun bewezen veiligheid erkend.\n\n{brandName} controleert en past zijn beveiligingsmaatregelen voortdurend aan om zich ontwikkelende cyberbedreigingen aan te pakken. Onze regelmatige beveiligingsaudits zorgen ervoor dat onze beveiligingsmethoden aan de industrienormen voldoen of deze overtreffen. De veiligheid van onze gebruikers heeft onze hoogste prioriteit en {brandName} is toegewijd om een veilige en gebruiksvriendelijke handelsomgeving te bieden. Uw vertrouwen is de drijvende kracht achter de steeds groeiende vooruitgang van {brandName}.",
  "96oo8Yq5o389Qt4hNRmqty": "Order bewerken",
  "9714bcf9f64d4000a55b": "Ons professionele interventieteam beheert beveiligingsproblemen rond de klok, volgens vastgelegde procedures. We voorspellen potentiële problemen, reageren onmiddellijk en voeren na een incident evaluaties uit om een effectieve reactie op noodsituaties te garanderen.",
  "97rDn5c8r9axPurnUZSTRp": "Profiteer met {brandName} van de halvingscycli van Bitcoin. Of u nu Bitcoin op de spotmarkt koopt of verkoopt, long of short gaat op Bitcoin door van de volatiliteit te profiteren, of ervoor kiest om passief inkomen op uw inactieve Bitcoin te verdienen, het robuuste platform van {brandName} zorgt voor een veilige ervaring bij het handelen op de markten.",
  "98acee1e18524000af2e": "{brandName} heeft gedetailleerde beveiligingsprotocollen opgesteld voor API-verbindingen, authenticatie, gegevensbescherming, de validatie van in- en uitvoer en snelheidsbeperking.",
  "98hKFZudY7idarYUXkajXf": "Ethereum Proof-of-Stake (PoS)",
  "99b947d9491d4000a5c7": "Detectie van schadelijke plugins",
  "99f11beaaa364000a3d8": "Er worden regelmatig beveiligingsincidenten gesimuleerd om ieders reactievermogen te testen, waaronder phishingtests, reactieoefeningen op incidenten en zogenaamde red team-oefeningen.",
  "99k7WVk3eymfiacNiM2JLv": "<span>Publieke sleutel:</span> uw <a href='{url}' target='_blank'>publieke sleutel</a> is vergelijkbaar met het adres van uw wallet. U kunt hem delen om geld te ontvangen of gedecentraliseerde applicaties (<a href='{dappsurl}' target='_blank'>dapps</a>) te gebruiken. De sleutel wordt uit de privésleutel gegenereerd, maar kan uw <a href='{url2}' target='_blank'>privésleutel</a> niet onthullen of ontcijferen.",
