  "9Vg9Ye1NshSRtk2XPYyH3c": "U kunt de statistieken van de miningpool controleren door naar het dashboard op de website van de pool te gaan. Dit dashboard geeft informatie over de hashrate, inkomsten en andere relevante statistieken weer.",
