  "9YRzfJQkHpD1ADcF5vJd2h": "De reden voor het blokkeren van de activa is in behandeling. We brengen u binnenkort op de hoogte.",
  "9b49625b13694000aa6f": "Het systeem voor accountbeveiliging van {brandName} bestaat uit twee delen: verificatie en risicobeheer. Ons protocol voor risicobeheer zet anti-phishingstrategieën bij verschillende scenario's in, zoals aanmeldingen, opnames en wijzigingen in de beveiligingsinstellingen. Het analyseert gebruikersapparaten, IP-adressen en gedrag in het verleden om potentiële risico's te kunnen inschatten. Als er een risico wordt gedetecteerd, worden er op basis van het specifieke scenario extra verificatiestappen gestart om accounts te beschermen.",
  "9bb956f7b7d74000a302": "Apparaat-ID's beheren",
  "9bedd0200f824000a39c": "{brandName} heeft een uniform platform voor het beheren en analyseren van operationele en beveiligingslogboeken. Dit zorgt ervoor dat alle handelingen en activiteiten onveranderlijk worden geregistreerd om aan de regelgeving te voldoen, toezicht mogelijk te maken, onderzoeken te ondersteunen en traceerbaarheid te garanderen.",
