  "a3ad8ebe7d904000af8e": "Wanneer gebruikers een API aanmaken of de pagina voor API-beheer openen, kunnen opnames alleen via het IP-adres van de gebruiker en de gespecificeerde opnameadressen worden uitgevoerd. Dit vermindert het risico op een beveiligingsinbreuk in het geval dat een API-sleutel is gelekt of verloren.",
