  "a775e0c384f34000a3a8": "{brandName} gebruikt afzonderlijke toestemmingen voor gebruikers KPI's, met inbegrip van algemene toestemmingen, toestemmingen voor de spothandel, marge en futures. Voor verschillende handelingen worden verschillende toestemmingsniveaus gehanteerd, waardoor wordt voorkomen dat er handelingen met verschillende toestemmingen worden uitgevoerd. Om de toestemmingen te wijzigen, moeten gebruikers eerst op hun account inloggen, waardoor de veiligheid van hun geld wordt gewaarborgd.",
  "a7P3fAoqk4dH8uaFvzj6Kq": "Min: {rate}",
  "a840f10cc4cf4000a46e": "API-sleutels en afzonderlijke accounts",
  "a8TpUFNDSYShm4cRjT5y1b": "Meer informatie",
  "a8c95b5ee1ea4000aebf": "De privacy van gebruikersgegevens beschermen is onze topprioriteit. {brandName} hanteert geavanceerde beveiligingsmaatregelen om de vertrouwelijkheid van gegevens te garanderen en ongeautoriseerde toegang te voorkomen. Gevoelige gegevens, waaronder wachtwoorden, transactiesleutels en persoonlijke identificatiegegevens, worden met de strengste maatregelen beschermd. Deze gegevens worden met zero-knowledge-proof methodes verwerkt, zodat zelfs het platform zonder uitdrukkelijke toestemming van de gebruiker geen toegang tot deze informatie heeft. Daarnaast worden alle gevoelige gegevens met geavanceerde versleutelingsalgoritmen versleuteld om de beveiliging nog verder te verbeteren.\n\nHet platform gebruikt speciaal ontworpen, specifieke databasesystemen om gevoelige informatie op te slaan, wat een extra beveiligingslaag biedt. Deze databases bevinden zich in een streng gecontroleerde interne netwerkomgeving. Containerisatiemethoden zorgen er vervolgens voor dat elke dienst in een afzonderlijke container wordt uitgevoerd, waardoor diensten met een zekere mate van isolatie van elkaar worden gescheiden. Deze aanpak garandeert dat diensten zelfs binnen het platform geen kruiselingse toegang tot gevoelige gegevens kunnen hebben. Door gegevens op deze manier te beveiligen, blijft het platform stabiel en schaalbaar.",
  "a8oyZqZr6dz72wSfrpqKCc": "Eenvoudig",
  "a9b72c3a46494000a10c": "1. We werken met erkende instellingen samen en zetten regelmatig geld op betrouwbare institutionele bankrekeningen om de veiligheid van het geld van de gebruikers te garanderen.\n2. We controleren of de rekeningnaam van de deposant met het account van de gebruiker overeenkomt om fraude en nalevingsrisico's te voorkomen.\n3. We controleren of de accountnaam van de ontvanger met de rekening van de gebruiker voor opnames overeenkomt om fraude en nalevingsrisico's te voorkomen.\n4. Voor alle stortings- en opnametransacties moet een uitgebreide KYC-verificatie (Know Your Customer) worden uitgevoerd.",
  "a9dae303ab5e4000a56d": "Wachtwoorden en andere gevoelige gegevens zijn niet toegankelijk zonder uitdrukkelijke toestemming van de gebruiker. {brandName} gebruikt een strikte authenticatie voor alle interne verzoeken, zodat alleen geautoriseerde diensten gegevens kunnen uitwisselen. Rolgebaseerde toegangscontrole (RBAC) beperkt de toegang tot gevoelige gegevens tot noodzakelijke handelingen, zodat zelfs bevoegde gebruikers en diensten hun machtigingen niet kunnen overschrijden.\n\nVoor een betere beveiliging voeren we regelmatig beveiligingsaudits en kwetsbaarheidsscans uit om ervoor te zorgen dat alle systemen aan de nieuwste standaarden en de beste werkwijzen voldoen. Het beveiligingsteam van {brandName} houdt opkomende bedreigingen nauwlettend in de gaten en reageert snel op elk potentieel incident. Tenslotte krijgen medewerkers ook regelmatig beveiligingstraining om de beste dagelijkse beveiligingsprocedures te handhaven.\n\nOmdat uw vertrouwen voor ons van het grootste belang is, doet {brandName} er alles aan om de privacy en beveiliging van de gegevens van onze gebruikers te beschermen. We verbeteren voortdurend onze beveiligingsmaatregelen om ons beter tegen de steeds geavanceerdere cyberbedreigingen te beschermen. Deze maatregelen zijn erop gericht om een veilige handelsomgeving te bieden, zodat onze gebruikers veilig en met vertrouwen kunnen handelen.",
