  "aboutus.about": "Over ons",
  "aboutus.community": "Community",
  "aboutus.feature1": "Door technologie aangedreven producten",
  "aboutus.feature1.intro": "We maken gebruik van geavanceerde technologieën om nuttige diensten te maken om de toegankelijkheid van de blockchain-revolutie te verbeteren.",
  "aboutus.feature2": "Een community waar iedereen zich thuis voelt",
  "aboutus.feature2.intro": "{brandName} ontwikkelt als een beurs van, voor en door het volk, een community waar iedereen van onze groei kan profiteren en zijn mening kan laten horen.",
  "aboutus.feature3": "KCS ontgrendelt het {brandName}-ecosysteem",
  "aboutus.feature3.intro": "We ontwikkelen een ecosysteem rond de {brandName} Token (KCS), die uw gids zal zijn in een bloeiende gedecentraliseerde wereld, gebouwd door alle leden van de {brandName}-community.",
  "aboutus.press": "Pers",
  "aboutus.story": "Ons verhaal",
  "aboutus.story.intro": "{brandName} is het werk van twee tech-nerds die zich al vroeg met blockchain bezig hielden. Michael begon op 8-jarige leeftijd met coderen en richtte op 16-jarige leeftijd zijn eerste startup op. Hij begon onmiddellijk BTC te minen toen hij in 2012 van zijn baas Eric voor het eerst over Bitcoin hoorde. Maar toen hij wat BTC probeerde te verkopen op Mt. Gox, ontdekte hij dat wat op dat moment 's werelds grootste platform was, moeilijk te gebruiken was voor beginners. Toen blockchain steeds meer werd toegepast, realiseerden Michael en Eric zich dat de technologie het financiële systeem aan het veranderen was in een systeem dat niet alleen de allerrijksten zou dienen, maar iedereen in de wereld - zelfs de lager opgeleiden, werklozen en mensen zonder bankrekening. Tegen het einde van 2013 schreven ze de eerste regels programmeertaal voor {brandName} in een café, en begonnen zo aan hun avontuur om een beurs te creëren die het voor iedereen mogelijk zou maken om crypto te gebruiken.",
  "aboutus.ten.item1": "Respecteer de financiële markt en beheer uw risico's",
  "aboutus.ten.item10": "Wees professioneel en volwassen",
  "aboutus.ten.item2": "Zakelijk en op de gebruikers gericht",
