  "assets.por.audit.intro.info": "De activa van {auditTime} UTC+8 zijn versleuteld en in een hash-boom samengevoegd. De huidige activagegevens van het account bevinden zich op het bladknooppunt. Zolang de topknoop ongewijzigd blijft, kan er niet met de activa van het bladknooppunt worden geknoeid.",
