  "assets.por.audit.progress": "Auditproces",
  "assets.por.audit.progress.content1": "Op een vast tijdstip wordt van alle gebruikersactiva een momentopname gemaakt en worden deze gegevens opgeslagen en versleuteld. Het verificatiepersoneel zorgt ervoor dat elke activa van alle gebruikers wordt opgenomen.",
  "assets.por.audit.progress.content2": "De UID-hash en het saldo van elke gebruiker vormen een blad van de hash-boom, en de som van alle gebruikersactiva de volledige hash-boom.<br/> Zodra de hash-boom is aangemaakt, worden eventuele wijzigingen opgemerkt.",
  "assets.por.audit.progress.content3": "De bijbehorende verifieerbare adressen van elk type activum en hun blokhoogtes op het tijdstip van de momentopname.<br/>\nEr is ook een speciale methode om het eigenaarschap van walletadressen te verifiëren.",
