  "assets.por.audit.verify.content1": "Houd er rekening mee dat factoren zoals het tijdstip van de momentopname en de opgenomen activa op uw account kunnen afwijken van de huidige activa op uw account.",
  "assets.por.audit.verify.content2": "De verificatie is geslaagd. De activa van deze persoon worden veilig opgeslagen en beschermd.<br/>\nAangezien iedereen aan de verificatie kan deelnemen, kan het totale aantal gebruikersactiva op het platform worden vertrouwd.",
