  "assetsBack.cs.airCoin.applyDes": "Controleer de gegevens van uw verzoek. Na goedkeuring stellen we u op de hoogte van de van toepassing zijnde servicekosten, die op uw betaalaccount in mindering worden gebracht om het terugvorderingsproces te voltooien. <br>Als uw activa niet kunnen worden teruggevorderd of als de reden voor het mislukken van de storting geen fout van uw kant was, worden er geen kosten in rekening gebracht. Als u met deze voorwaarden akkoord gaat, klikt u op Bevestigen en verwerken we uw verzoek.",
  "assetsBack.cs.airCoin.reason1": "<span>Als het blockchain-netwerk van de gestorte cryptovaluta niet op {brandName} wordt ondersteund, of <span class='{style}'>als de cryptovaluta die u heeft gestort niet op {brandName} is genoteerd of is verwijderd</span>, wordt de storting niet bijgeschreven.</span>",
  "assetsBack.cs.airCoin.reason2": "<span>Om de beveiliging van uw geld te garanderen, <span class='{style}'>kunnen we uw storting alleen op het originele adres op de blockchain terugstorten zodra deze is goedgekeurd, en ontvangt u vervolgens de TxID van de terugbetaling. Als er sprake is van bijzondere omstandigheden, neem dan via support@kucoin.com contact met onze officiële klantendienst op.</span> Als het bronadres van de storting een ander platform is, neemt u zodra we de terugbetaling hebben voltooid contact met het betreffende platform op voor de volgende stappen.</span>",
