  "assetsBack.form.tips1": "Om de veiligheid van uw geld te waarborgen, <span class='{style}'>kunnen we het door u gestorte geld alleen zonder memo's, tags of berichten op het bronadres terugstorten.</span> Als het adres waarvan de storting is gemaakt in bezit van een platform is, neemt u nadat KuCoin uw geld heeft teruggestort contact met het betreffende platform op voor verdere ondersteuning. Als er speciale omstandigheden zijn, neemt u via support@kucoin.com contact met ons op.",
  "assetsBack.form.tips2": "Let op: om uw activa te beschermen, kunnen we teruggevorderd geld alleen op het bronadres van de oorspronkelijke storting terugstorten (d.w.z. het adres vanwaar het op de blockchain is verzonden). Neem voor eventuele bijzondere omstandigheden via support@kucoin.com contact met onze klantendienst op. Als het retouradres een hot walletadres van een ander platform is, moet u voor aanvullende assistentie contact met dat platform opnemen zodra de terugstorting door ons is voltooid.",
