  "assetsBack.reason1": "Ik heb bij mijn storting de verkeerde Tag/Memo opgeven of ben het vergeten te specificeren.",
  "assetsBack.reason1.confirmModelDes": "Bevestig alstublieft dat de informatie in uw aanvraag correct is. Zodra uw aanvraag is goedgekeurd, contacteren we u om de bijbehorende kosten te betalen. Nadat we uw aanvraag hebben voltooid, verstrekken we u de TxID van de teruggestuurde storting.",
  "assetsBack.reason1.des1": "Voor bepaalde cryptovaluta zoals XLM, EOS en XRP moet tijdens het stortingsproces een tag of memo worden ingevuld. Als u niet zowel het adres als de tag correct invoert, mislukt de storting.",
  "assetsBack.reason1.des2": "Om de veiligheid van uw geld te waarborgen, <span class='{style}'>kunnen we gestort geld alleen zonder memo's, tags of berichten op het bronadres terugstorten. De TxID van het teruggestorte geld wordt verstrekt.</span> Als het bronadres van de storting een ander platform toebehoort, moet u voor verdere ondersteuning contact met hen opnemen wanneer we de retourzending bij ons hebben voltooid. Als er bijzonderheden zijn, neem dan via support@kucoin.com contact met ons op.",
  "assetsBack.reason1.des3": "Als u per ongeluk een tag of memo heeft opgegeven die aan een andere gebruiker toebehoort, kan het zijn dat uw geld op hun account is gestort. In dergelijke gevallen kunnen we helaas geen verdere hulp bieden.",
