  "beginnerZone.rule.item6": "6. Geldige handelstransacties zijn onder meer handelstransacties op de futures-, spot- en margehandel, aankopen van {brandName} Earn producten en door de handelsbot uitgevoerde handelstransacties. De waarden worden berekend op basis van het transactiebedrag op het moment van de succesvolle plaatsing van de order.",
  "beginnerZone.rule.item7": "7. Er kan een vertraging optreden bij het verwerken van de gegevens. Als de gegevens niet zijn bijgewerkt, kunt u de pagina verversen of contact met de klantendienst opnemen.",
  "beginnerZone.rule.item8": "8. De beloningen worden doorgaans binnen {num} dagen uitgekeerd, maar er kunnen vertragingen optreden. Als u een fiat-kortingscoupon gebruikt, wordt het kortingsbedrag terugbetaald nadat u een order heeft geplaatst.",
  "beginnerZone.rule.item9": "9. In de mystery-boxen kunnen de volgende beloningen zitten: Futures kortingcoupons, Futures-demofondsen, coupons met renteverhoging, Fiat kortingcoupons, populaire munten, kortingcoupons voor de handelskosten, margebonussen, rentevrije coupons en meer.",
  "beginnerZone.rule.other": "Aanvullende regels",
  "beginnerZone.rule.other.item1": "1. De beloningen moeten binnen {num} dagen worden geclaimd, anders vervallen ze.",
  "beginnerZone.rule.other.item2": "2. Subaccounts komen voor dit evenement niet in aanmerking. Via subaccounts uitgevoerde stortingen worden niet meegerekend.",
  "beginnerZone.rule.other.item3": "3. De USD-waarden van tijdens dit evenement gemaakte stortingen en handelstransacties worden met realtime wisselkoersen berekend.",
  "beginnerZone.rule.other.item4": "4. {brandName} behoudt zich het recht voor deelnemers die zich aan frauduleuze of illegale activiteiten schuldig maken, te diskwalificeren en hun beloningen in te trekken.",
  "beginnerZone.rule.other.item5": "5. {brandName} behoudt zich het recht voor dit evenement te annuleren, te wijzigen of de regels van dit evenement te veranderen.",
  "beginnerZone.rule.other.item6": "6. Alle deelnemers moeten zich strikt aan de gebruiksvoorwaarden van {brandName} houden.",
  "beginnerZone.rule.other.item7": "7. {brandName} behoudt zich alle rechten voor op de uiteindelijke invulling van het evenement. Neem als u vragen heeft contact met de klantendienst op.",
