  "c0c8227aee4d4000ada5": "{brandName} controleert rond de klok de beveiliging en waarschuwingen, waardoor de controlescenario's voortdurend worden verbeterd en waarschuwingen worden geautomatiseerd om beveiligingsincidenten en verdachte activiteiten direct te detecteren en aan te pakken.",
  "c147f9Dmj8CzjL1qJy6Pd5": "<span>Kies uw cryptovaluta:</span> controleer of de miningpool ondersteuning biedt voor de cryptovaluta die u wilt minen, zoals <a href='{btcurl}'  target='_blank'>Bitcoin</a> of <a href='{url}'  target='_blank'>Litecoin</a>.",
