  "cAma7RLEfixwbSc7RD4rvf": "De Bitcoin-halving is een geplande gebeurtenis die ongeveer elke vier jaar, of nadat 210.000 blokken zijn gemined, plaatsvindt.",
  "cBtMERERqR8AmduwsiF8fq": "Een overzicht van de belangrijkste mijlpalen op Ethereums traject naar ETH 2.0, met inbegrip van de Shanghai-upgrade en de gevolgen van danksharding.",
