  "cK3356F74q5r1qrynPVYtj": "Juist beantwoord: <span class={className}>{text}</span>",
  "cLfojvQLgkQL2PDKBRAkwa": "De Bitcoin-halving, die elke vier jaar de beloningen voor miners met 50% vermindert, vindt naar verwachting rond april 2024 opnieuw plaats. Leer meer over hoe u deze cruciale gebeurtenis op {brandName} kunt verhandelen en er uw voordeel mee kunt doen.",
