  "cRN8dqRBPPQTsRsXAxHVCy": "<span>Diversifieer uw portefeuille:</span> beleg niet al uw geld om één enkele handelaar te kopiëren. Diversifieer tussen verschillende handelaren, markten en handelsstijlen om risico's te spreiden.",
  "cSkhMytfk9TJsiunSzqjFQ": "(1) In e-mails van {brandName} of meldingen op de website.",
  "cTqCKJWMgZatbJz6nNJiG8": "Totale schuld",
  "cUcTs3UQjNCKViLLG1ReFE": "Na The Merge was de volgende belangrijke mijlpaal van Ethereum de <a href='{url}' target='_blank'>Shanghai/Capella-upgrade</a> in april 2023. Deze upgrade verbeterde de netwerkmogelijkheden aanzienlijk, in het bijzonder de optie om staked ETH op te nemen. Deze functie markeerde een belangrijke stap om het staken van Ethereum voor de ruimere crypto-community toegankelijker te maken.",
  "cUhzWF2wWog7MYqXRWwSTv": "Subaccounts kunnen alleen orders van de spot-, marge-, futures-handel en Convert exporteren.",
  "cWEVRDeZQNd55sy1RGC9aM": "Automatisch oprenten is mislukt.",
  "cWihMsQrub1isit5KGf9mw": "Snowball",
