  "cYPxCcdTiCQkuZg216uNRS": "Web3 wallets kunnen met verschillende blockchain-netwerken verbinding maken. Hierdoor kunt u verschillende soorten cryptovaluta beheren, omdat elke blockchain zijn eigen regels en ondersteunde activa heeft.",
  "cYT8Z7NhzFg7DZmWWNHa29": "De aflossingsperiode wordt door het staking-protocol bepaald. Elke cryptovaluta heeft zijn eigen wachttijd wanneer u stopt de activa te staken. Gedurende deze periode worden er geen beloningen of rendement opgebouwd.",
