  "etf.answer.five.content1": "i. Handelskosten: in rekening gebracht bij het kopen/verkopen van de hefboomtokens op de spotmarkt. De kosten zijn dezelfde als die bij de spothandel.",
  "etf.answer.five.content2": "ii. Inschrijvingskosten: in rekening gebracht wanneer u zich op een hefboomtoken inschrijft. De kosten bedragen momenteel {feeRate}% van elke inschrijving.",
  "etf.answer.five.content3": "iii. Aflossingskosten: in rekening gebracht wanneer u een hefboomtoken aflost. De kosten bedragen momenteel {feeRate}% van elke aflossing.",
  "etf.answer.five.content4": "iv. Beheerskosten: worden elke dag om 07:45 (UTC+8) in rekening gebracht tegen een tarief van {managementFees}%. De kosten zijn verwerkt in de intrinsieke waarde van de hefboomtokens en hebben geen invloed op uw bezit. Aangezien beheerkosten dagelijks automatisch in rekening worden gebracht, moeten handelaren voorzichtig zijn wanneer ze hefboomtokens op de lange termijn willen vasthouden.",
  "etf.answer.five.tilte": "De kosten voor {brandName} hefboomtokens zijn als volgt:",
  "etf.answer.one": "{brandName} hefboomtokens zijn verhandelbare activa op de {brandName}-spotmarkt die winsten vergroten door long/short te gaan op de onderliggende activa. Wanneer bijvoorbeeld de prijs van BTC met 1% stijgt, stijgt de prijs van BTC3L met 3% en daalt de prijs van BTC3S met 3%. In tegenstelling tot de margehandel of futures-handel is er geen onderpand of margehandhaving vereist om hefboomtokens aan te houden en zijn er geen liquidatierisico's. Merk op dat hefboomtokens erg volatiel kunnen zijn. Handelaren moeten behoedzaam met hun beleggingen omgaan.",
  "etf.answer.six.content1": "i. Vergeleken met de spotmarkt kent de markt voor tokens met hefboomwerking hogere risico's en onzekerheden. Het aanhouden van hefboomtokens kan op dagelijkse basis resulteren in talrijke winsten en verliezen.",
  "etf.answer.six.content2": "ii. Het herbalanceringsmechanisme en de beheerskosten zorgen ervoor dat hoe langer u een hefboomtoken in bezit heeft, des te meer kosten u moet betalen. Handelaren moeten daarom behoedzaam zijn wanneer ze hefboomtokens op de lange termijn willen aanhouden.",
  "etf.answer.step1.content": "U kunt de hefboomtokens verhandelen op de spotmarkt van {brandName}. Ga naar de pagina met hefboomtokens en zoek uw favoriete tokens, klik op 'Handelen' om ze te kopen of verkopen.",
  "etf.answer.step1.title": "i. De spotmarkt op {brandName} (aanbevolen)",
  "etf.answer.step2.content": "{brandName} verwerkt de inschrijvings- en aflossingsverzoeken elke dag om {unifiedSubmissionTimePoints}. De prijzen voor de inschrijving/aflossing worden bepaald door de resultaten van de uitvoering, wat betekent dat het precieze tijdstip en de prijs onzeker zijn. Handelaren worden geadviseerd voorzichtig te zijn met beleggen.",
  "etf.answer.step2.title": "ii. Inschrijving/Aflossing",
  "etf.answer.three": "Het herbalanceringsmechanisme maakt {brandName} hefboomtokens een goede keuze voor eenzijdige marktbewegingen, maar een slechte keuze voor fluctuerende markten. Wanneer er een hoge volatiliteit heerst, kunnen er gedurende de dag meer nettoverliezen optreden. Wees daarom voorzichtig bij het beleggen.",
  "etf.answer.two": "Elke {brandName} hefboomtoken vertegenwoordigt een aandeel van een fonds met hefboomwerking. De fondsbeheerder zorgt ervoor dat het fondsrendement gebaseerd is op een specifiek veelvoud van de onderliggende activa en dat handelaren dat specifieke veelvoud van de winst van de onderliggende activa kunnen realiseren. Wanneer de volatiliteit aan de andere kant de limiet overschrijdt, wordt een herbalanceringsmechanisme gebruikt om risico's af te dekken en zo het nettoverlies te beheersen.",
  "etf.apply.alert": "<div>De dagelijkse verwerking vindt om {unifiedSubmissionTimePoints} plaats. Inschrijvings- en aflossingsprijzen zijn op de laatst uitgevoerde handelstransactie gebaseerd. </div><div>Om eventuele risico's of onzekerheid te verminderen, raden we aan op de spotmarkt te handelen.</div><div class='tip'>Let op: wanneer u zich inschrijft of aflost, worden uw activa altijd op het eerstvolgende geplande verwerkingstijdstip bijgeschreven.</div>",
