  "fL7UnR7fGBuBmBj9ptbD76": "Pro",
  "fLqeckfJ16QX33Q7skx1Ch": "U heeft al een {coin} adres met dezelfde opmerking. Let er op dat u ze van elkaar onderscheid wanneer u ze gebruikt.",
  "fPoz13ans9Sg2oT2t2JU6z": "Opnames geblokkeerd",
  "fQjMAkUAQSfPs29m44gwYz": "<span>Oefen, leer en beheers uw verwachtingen</span>: gebruik in eerste instantie een demo-account om de kopieerhandel te leren kennen. Benut het als een kans om meer te weten te komen over markttrends, begrijp dat handelen risico's met zich meebrengt en stel uw verwachtingen dienovereenkomstig bij. Wees u bewust van eventuele andere gerelateerde kosten en neem contact met de community van het platform op voor inzichten en om ervaringen uit te wisselen.",
