  "fRZbnDHRT6v7UEKnj6JBjh": "<span>Update uw wallet regelmatig:</span> door de software van uw wallet bij te werken, bent u verzekerd van de nieuwste beveiligingspatches en -oplossingen voor bekende kwetsbaarheden.",
