  "288ee3f258534000a134": "KuCoin Ventures belegt in en ondersteunt innovatieve blockchain-projecten in sectoren zoals infrastructuur, DeFi, NFT's en SocialFi, en stimuleert de voortdurende groei van het Web3-ecosysteem.",
  "2bc2d33b535b4000ac09": "We ontwikkelen ons voortdurend om aan de behoeften van moderne handelaren te voldoen en bieden geavanceerde tools en een naadloze handelservaring.",
  "2ecd9e9b835f4000af50": "Web3-interoperabiliteitsinfrastructuur",
  "3a1d43481cdb4000a587": "E-mail",
  "3ccc4f64a7ab4000a0e2": "Als een op de community en op onderzoek gerichte belegger werkt KuCoin Ventures nauw samen met zijn portefeuilleprojecten gedurende hun hele levenscyclus, met een specialisatie in DeFi, GameFi en Web3-infrastructuur.",
  "3ced5ea1db9f4000af5b": "Gedecentraliseerde, Ethereum-equivalente ZK-rollup",
  "4e0b5341981e4000a9af": "Veiligheid eerst",
  "581fedf360194000a8ec": "Gedecentraliseerd besturingssysteem",
  "59faeed1a8cf4000a094": "Layer1 voor chain abstractie zonder wallet",
  "5bd44eada21d4000ae67": "KuCoin Ventures ondersteunt crypto- en Web3-bouwers zowel financieel als strategisch, door diepgaande inzichten te bieden en gebruik van wereldwijde middelen.",
  "5d01bcc193c54000a0c1": "Openstaande vacatures bekijken",
  "5d0321509ade4000afe7": "Een allesomvattende gedecentraliseerde beurs",
  "5eedfcd04c8e4000a152": "Innovatief handelen",
  "639afd5beda54000a272": "Sla de handen ineen om de toekomst vorm te geven",
  "64f878358ab64000a8d0": "Web3-incubator",
  "67f9cb69ac0e4000a169": "Sluit u bij KuCoin aan en maak deel uit van een toekomst die op openheid, integriteit en passie is opgebouwd.",
  "6a1ac3fe9f8f4000ab62": "Tot een wereldwijd gerespecteerd technologiebedrijf uitgroeien dat innovatie in de crypto-sector stimuleert.",
  "6ea33259dec64000a53d": "Sociale systemen voor Web3",
  "7524379504f44000ac34": "De <span class='hl-text'>vrije stroom van <br/>digitale waarde wereldwijd</span> bevorderen",
  "7762b1cabbcf4000a1cd": "Uw veiligheid is onze hoogste prioriteit. We beschermen uw activa met toonaangevende beveiliging en zorgen zo voor volledige gemoedsrust.",
  "7b43d074282b4000a338": "Het begon allemaal met Michael, een gepassioneerde programmeur die al op zijn achtste begon met coderen en op zijn zestiende zijn eerste start-up oprichtte. In 2012 maakte hij via zijn baas, Eric, kennis met Bitcoin, waarna ze samen vol enthousiasme in de wereld van het minen doken. Maar toen Michael voor het eerst BTC wilde verkopen op Mt. Gox—destijds de grootste beurs—merkte hij al snel hoe ingewikkeld en ontoegankelijk de handel in crypto voor beginners was, terwijl het juist de potentie had om de financiële wereld volledig te veranderen.",
  "7d7838da36ea4000a98c": "Web3 multi-chain app store voor crypto",
  "7fa0d0df97424000a257": "De voor gamers geoptimaliseerde blockchain",
  "86f4b83859364000aaa7": "SocialFi-app",
  "8891a013712e4000a472": "Naarmate blockchain steeds breder werd omarmd, zagen Michael en Eric de revolutionaire impact ervan—niet alleen voor de rijken, maar voor iedereen, inclusief mensen zonder bankrekening of toegang tot financiële diensten. Eind 2013 zaten ze in een café en schreven de eerste regels code voor wat later KuCoin zou worden—De beurs voor iedereen, een platform dat drempels wegneemt en crypto voor iedereen toegankelijk maakt.",
  "8eb597d442274000a1ee": "Geldmarkt voor het SUI-ecosysteem",
  "931d0a8829fa4000aab0": "De overstap naar blockchain en cryptovaluta bevorderen door wereldwijd een vrije stroom van digitale waarde mogelijk te maken.",
  "9adf29707ebc4000a467": "Missie",
  "a23f71374c5e4000a362": "De toonaangevende beleggingsafdeling van de KuCoin-beurs",
  "a4d0df02a97f4000a741": "Beurs voor synthetisch rendement met hefboomwerking",
  "b64124e449ee4000a742": "Uitgever en ontwikkelaar van play-and-earn games op meerdere platforms",
  "b84161bcdd5e4000a70b": "Ons verhaal",
  "babf517cd7614000a650": "KuCoin Ventures werkt samen met toonaangevende beleggingsfondsen om innovatieve blockchain-projecten te ondersteunen en groei in het Web3- en crypto-ecosysteem te bevorderen.",
  "c10b4e0fdd304000ab1d": "<span class=\"web3\">Web3</span> en <span class=\"tech\">toekomstige technologieën</span> bevorderen",
  "c25f2a1fc8ad4000a4ed": "Een durfkapitaalfonds dat wereldwijd gespecialiseerd is in beleggingen in cryptoprojecten in een vroeg stadium.",
  "c44b0e64e2ac4000a85b": "Gedecentraliseerd liquiditeitsprotocol op SUI",
  "c979d478b8ab4000a0c8": "Grensverleggende kansen",
  "d637b3a566894000a742": "Durfkapitaal",
  "d7bcc8e004234000ac88": "Gedecentraliseerd ZK-RaaS-netwerk",
  "e0bdc1ffdeaf4000aed7": "KuCoin is opgericht door twee techfanaten die, met een visie om cryptovaluta voor iedereen toegankelijk te maken, al vroeg het potentieel van blockchain zagen.",
  "e2fd47cd88394000a1c3": "Aanvraag indienen",
  "e354f44e68584000aafa": "Gedecentraliseerde rekeninfrastructuur",
  "f0f30111507d4000aa73": "Onze portefeuille",
  "f273ff4318a74000ac49": "KuCoin Ventures streeft ernaar in de crypto- en blockchain-projecten te beleggen die de meeste verandering teweegbrengen en het Web3-tijdperk vormgeven.",
  "f44dd159465f4000a8c0": "De meest geprezen hoogwaardige NFT",
  "f4857287756d4000affb": "KuCoin is een toonaangevende globale cryptobeurs, vertrouwd door meer dan 40 miljoen gebruikers in meer dan 200 landen. Ons aanbod omvat de spot- en margehandel, opties en perpetual futures, en eveneens DeFi, kredietverlening en mining-diensten.",
  "f5cfd00af36a4000a820": "Visie",
  "f613f66566a54000acf4": "Geautomatiseerde aggregator voor samengesteld rendement",
  "6ad997ad569f4000a532": "Een institutionele vermogensbeheerder die zich uitsluitend op blockchain en digitale activa richt en in publieke ketens, protocollen, applicaties en aanbieders van cryptofinanciering belegt.",
  "d16b36fbb31b4000a406": "of",
  "8a8d43d3bb784000a2ad": "1. Centralized SSL/TLS certificate lifecycle management\n2. User data transmissions are protected via HTTPS, supporting the most advanced security protocols and blocking weak cryptographic ciphers",
  "f2966969ff594800a7a2": "Frequent testing and assessments are conducted throughout the development lifecycle to secure our code, certificates, and communications.\n1. Code Scanning: Static Vulnerability Assessments (SVA) and Dynamic Vulnerability Assessments (DVA) are done in conjunction with shift-left security practices.\n2. SSL/TLS Certificate Management: Standardized and centralized full lifecycle management protects the integrity of SSL/TLS certificates.\n3. Data Transmission: User data is protected via HTTPS, supporting the most advanced security protocols and blocking weak cryptographic ciphers.",
